export function add40(a: number, b: number): number {
  return a + b;
}

export function subtract40(a: number, b: number): number {
  return a - b;
}

export function multiply40(a: number, b: number): number {
  return a * b;
}

export function divide40(a: number, b: number): number {
  return a / b;
}
